import React from 'react'
import {useNavigate} from 'react-router-dom';
const PageNotFound = () => {
    let navigate=useNavigate();
  return (
    <div>
      <b> 404 Page Not Found</b>
      <br/>
      <b onClick={()=>navigate('/')}
      style={{
        color:"green",
        cursor: "pointer"
      }}
      >Homepage</b>
    </div>
  )
}

export default PageNotFound
